import {
  Container,
  Nav,
  Navbar,
  NavDropdown,
  Form,
  Button,
  Row,
  Col
} from "react-bootstrap";
import { useEffect, useState } from "react";
import logo from "../images/logo.png";
import avatar from "../images/blank_avatar.png";
import { useNavigate, Link } from "react-router-dom";
import Apis, { endpoints } from "../configs/Apis";


const Header = () => {
  const [cities, setCities] = useState(null);
  const [cates, setCates] = useState(null);
  const [kw, setKw] = useState("");
  // const [user, setUser] = useState([]);
  const nav = useNavigate();

  const loadCities = async () => {
    let res = await fetch(
      "https://www.themealdb.com/api/json/v1/1/list.php?a=list"
    );
    let data = await res.json();

    setCities(data.meals);
  };

  const loadCates = async () => {
    let data = await Apis.get(endpoints['categories'])
    setCates(data);
  };

  useEffect(() => {
    loadCities();
    loadCates();
  }, []);

  const search=(evt) =>{
    evt.preventDefault();
    nav(`\?kw=${kw}`)
  }

  return (
    <>
      <Navbar data-bs-theme="light" expand="lg" className="bg-body-tertiary">
        <Container>
          <Navbar.Brand>
          <Link to='/'> 
            <img
              alt=""
              src={logo}
              width="50"
              height="50"
              className="d-inline-block align-top"
            />{" "}
            </Link>
          </Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mx-auto">
              <NavDropdown title="Tỉnh thành" id="basic-nav-dropdown">
                {cities.map((c) => (
                  <NavDropdown.Item className="drop-item">
                  <Link to={`/${c.strArea}`}>
                      {c.strArea}
                    </Link>
                  </NavDropdown.Item>
                ))}
              </NavDropdown>
              <NavDropdown title="Danh mục" id="basic-nav-dropdown" className="nav-dropdown-cate">
                { cates && cates.map((c) => (
                  <NavDropdown.Item className="drop-item">
                    {c.strCategory}
                  </NavDropdown.Item>
                ))}
              </NavDropdown>

              <Form onSubmit={search} inline>
                <Row>
                  <Col xs="auto">
                    <Form.Control
                      type="text"
                      placeholder="Địa điểm , món ăn..."
                      value={kw}
                      onChange={e=>setKw(e.target.value)}
                      className="mr-sm-2"
                      aria-label="Search"
                    />
                  </Col>
                  <Col xs="auto">
                    <Button className="btn-search" variant="outline-success" type="submit">
                      Tìm kiếm
                    </Button>
                  </Col>
                </Row>
              </Form>
            </Nav>
            <NavDropdown title={
                    <div className="pull-left">
                        <img className="thumbnail-image" 
                            src={avatar} 
                            roundedCircle width="45" height="35" alt="user"
                            />
              </div>
              } id="basic-nav-dropdown">
                <>
                <NavDropdown.Item>
                    <Link to={`/Login`}>
                      Login
                    </Link>
                </NavDropdown.Item>
                <NavDropdown.Item>
                  <Link to={`/Register`}>
                      Register
                    </Link>
                  </NavDropdown.Item>
                  </>
            </NavDropdown>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </>
  );
};

export default Header;
